import styled from 'styled-components';

const DetailList = styled.ul`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  font-size: 1.8rem;
  font-weight: 400;
  grid-gap: 6rem;
`;

export default DetailList;
